import React from "react";

function UserDetails(props) {
  const { name, rID, uID, email, dID } = props.user;

  return (
    <div>
      <div className="absolute top-40 right-8 w-3/4 h-12">
        <div className="absolute top-16 right-2 w-full h-auto bg-white p-2">
          <div className="pb-4">
            <h1 className="text-xl font-serif font-semibold">Name</h1>
            <p className=" text-xl font-serif ">{name}</p>
          </div>

          <div className="pb-4">
            <h1 className="text-xl font-serif font-semibold">User ID</h1>
            <p className=" text-xl font-serif ">{uID}</p>
          </div>

          <div className="pb-4">
            <h1 className="text-xl font-serif font-semibold">Roll ID</h1>
            <p className=" text-xl font-serif ">{rID}</p>
          </div>

          <div className="pb-4">
            <h1 className="text-xl font-serif font-semibold">Department ID</h1>
            <p className=" text-xl font-serif ">{dID}</p>
          </div>

          <div className="pb-4">
            <h1 className="text-xl font-serif font-semibold">Email</h1>
            <p className=" text-xl font-serif ">{email}</p>
          </div>
        </div>

        <div>
          <button
            className="absolute top-0 left-40 bg-red-400 w-40 hover:bg-red-500 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
            type="button"
          >
            Detail Report
          </button>

          <button
            className="absolute top-0 right-40 bg-red-400 w-40 hover:bg-red-500 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
            type="button"
          >
            Delete
          </button>

          <button
            className="absolute top-0 right-64 -translate-x-60 bg-red-400 w-40 hover:bg-red-500 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
            type="button"
          >
            Update
          </button>
        </div>
      </div>
    </div>
  );
}

export default UserDetails;
